30 Rock episode 4 - &quot;Jack the Writer&quot;

Jack decides to join Liz and her staff in the writers&amp;#039; room, but his lack of writing ability becomes all too evident and his presence ends up stifling the others&amp;#039; creativity. Tracy mentors Kenneth on how to be successful and Liz encourages Cerie, her nubile assistant, to dress less revealingly. 

Air date - October 31, 2006
